import React, { useState, useCallback } from "react";
import { AssistentContentContainer } from "./frame/AssistentConentContainer";
import { AssistentFlow } from "./frame/AssistentFlow";
import { OnboardingContext, initialOnboarding } from "./OnboardingContext";
import { ProductOffers } from "./offer/ProductOffers";
import { Payment } from "./payment/Payment";

interface Props {
}



export const Onboarding: React.FC<Props> = (Props) => {

    const [step, setstep] = useState(0)
    const [pricePlan, setpricePlan] = useState("")

    const setStep = useCallback((step: number): void => {
        setstep(step);
    },[])

    const setPricePlan = useCallback((productId: string): void => {
        setpricePlan(productId);
    },[])

   const initValue = initialOnboarding;
   initValue.setStep= setStep;
   initValue.step=step;
   initValue.setPricePlan= setPricePlan;
   initValue.pricePlan=pricePlan;

   console.log(step)

   return (
        <OnboardingContext.Provider value={initValue}> 
            <AssistentFlow >
                <ProductOffers />
                <Payment />
                <AssistentContentContainer>
                    Bezahlen
                </AssistentContentContainer>
                <AssistentContentContainer>
                    Fertig
                </AssistentContentContainer>
            </AssistentFlow>  
        </OnboardingContext.Provider>
    )
}
